import React from 'react'


const Modal = ({ onClose = () => { }, children }) => {
    // body: ["Pronto para manuseio","00:05:00","Saúdavel","CD, Polo, Retire na Loja"]
    //THEAD
    const arrayObject = [
        {
            status: "STATUS",
            lastUpdate: "ÚLTIMA ATUALIZAÇÃO",
            situation: "SITUAÇÃO",
            affectedOperation: "OPERAÇÃO AFETADA"
        },
        {
            statusb: "Pronto para manuseio",
            lastUpdateb: "00:05:00",
            situationb: "Saúdavel",
            affectedOperationb: "CD, Polo, Retire na Loja"
        }
    ]





return (

    <div className="modal">
        <div className="container">
            <button className="close" onClick={onClose}>X</button>
            <div className="title">
                <h3>Monitoria ocorrência de atualizações de status de pedidos</h3>
            </div>
            <hr />
            <div className="content">
                <table className="table">
                    <thead className="tablehead">
                        {arrayObject.map((e) => {
                            return (
                                <tr>
                                    <th>{e.situation}</th>
                                    <th>{e.lastUpdate}</th>
                                    <th>{e.situation}</th>
                                    <th>{e.affectedOperation}</th>
                                </tr>

                            )
                        })}
                    </thead>
                    <tbody>
                        {arrayObject.map((e) => {
                            return (
                                <tr>
                                    <td></td>
                                    <td>00:05:00</td>
                                    <td>Saúdavel</td>
                                    <td>CD, Polo, Retire na Loja</td>
                                </tr>
                            )
                        })
                        }
                        <tr>
                            <td>Pronto para manuseio</td>
                            <td>00:05:00</td>
                            <td>Pouco Saúdavel</td>
                            <td>CD</td>
                        </tr>

                    </tbody>
                </table>
            </div>
        </div>


    </div>
)

}
export default Modal;
